	$("#taxonomy_tree").bind("reselect.jstree", function () {
		  $("#taxonomy_tree").bind("select_node.jstree", function (e, data) {
			  console.log("Selected node = "+ data.rslt.obj.attr("id"));

		        var node = data.rslt.obj;

		        var tree_type = $('input[name=treeChoice]:checked', '#treeForm').val();

		        if(tree_type=='#classification_tree'){
					tree_type = 'classification';
		        }else if(tree_type=='#taxonomy_tree'){
					tree_type = 'taxonomy';
		         }

		        $(this).jstree("uncheck_all");
		        
		        $(this).jstree('check_node', node);

		        var checked_ids = []; 		
		    	$($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("get_checked",null, true).each(function() {   
		 	   checked_ids.push(this.id); 
		     	});

		    	console.log('checked ids:'+checked_ids);	
		       	console.log('tree type:'+tree_type);
		       	
		     if(!checked_ids.length<=0)
		    
		    	 $.post(CLASSIFICATION_URL, {checked_ids:checked_ids, tree_type:tree_type},
		    		        function(data){
		    		        	 var results = data.getElementsByTagName("results") ;
		    		             $(data).find('results').each(function(){  
		    		                 var $results = $(this);
		    		                 var url      = $results.find('url').text();  
		    		                 url = url.replace(/:/g,"/");
		    		                 url = '/chembl/'+'index.php'+url;
		    		                 location.href = url;
		    		             });
		    		        },'xml'); return false;		   
			  });

		});
	
	$("#classification_tree").bind("check_node.jstree", function (e, data) {
		console.log('checked');
		$('.fetch').removeAttr("disabled");
	});


	$("#classification_tree").bind("uncheck_node.jstree", function (e, data) {
		console.log('unchecked');
		
		//if no checkboxes are selected after an uncheck checkbox event then we disable the submit button
		 var checked_ids = []; 		
	       	$($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("get_checked",null, true).each(function() {   
	    	   checked_ids.push(this.id); 
	        });
	        if(checked_ids.length<=0)
	        $('.fetch').attr('disabled','disabled');        
	});

