	 $("#searchBtn").click(function(e){
		 e.preventDefault();   
		 $search_string = $("#search").val();
		 $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("search", $search_string);
     }); 

	   // catch enter code in search form in front page
	 $('#search').keypress(function (e) {
	
		 $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("close_all");
	     	if (e.keyCode == 13) {
	    	 $search_string = $("#search").val();
		     $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("search", $search_string);
		 	//prevent the form submitting 
		     e.preventDefault();	
	     }
	 });
	 		
	 $("#check_all").click(function(e){
		 e.preventDefault();
		//var active_tree = $('input[name=treeChoice]:checked', '#treeForm').val();
		//console.log('active tree: '+active_tree);
        $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("check_all");
        $('.fetch').removeAttr("disabled");
     }); 	
	
	 $("#clear").click(function(e){
		 e.preventDefault();   
        $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("uncheck_all");
        $('.fetch').attr('disabled','disabled');    
     }); 

	 $("#collapse").click(function(e){
		 e.preventDefault();   
        $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("close_all");
     });

	 $("#open").click(function(e){
		 e.preventDefault();   
        $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("open_all");
     });  
         
	$("#treeForm").submit(function(e){   
	   console.log('tree form submitted');	  
       e.preventDefault();   
       var checked_ids = []; 		
       $($('input[name=treeChoice]:checked', '#treeForm').val()).jstree("get_checked",null, true).each(function() {   
    	   checked_ids.push(this.id); 
        });

        if(checked_ids.length<=0)
        return false;

		var tree_type = $('input[name=treeChoice]:checked', '#treeForm').val();

        if(tree_type=='#classification_tree'){
			tree_type = 'classification';
        }else if(tree_type=='#taxonomy_tree'){
			tree_type = 'taxonomy';
            }
       	console.log('checked ids:'+checked_ids);	
       	console.log('tree type:'+tree_type);
       	
        $.post(CLASSIFICATION_URL, {checked_ids:checked_ids, tree_type:tree_type},
        function(data){
        	 var results = data.getElementsByTagName("results") ;
             $(data).find('results').each(function(){  
                 var $results = $(this);
                 var url      = $results.find('url').text();  
                 url = url.replace(/:/g,"/");
                 url = '/chembl/'+'index.php'+url;
                 location.href = url;
             });
        },'xml'); return false;
          
    });
	
